   private void convert(Graph graph)
   {
      String kind=CbReprezentation.getSelectedItem().toString();
      String content = GraphReprezentationFabric.get(kind).convert(graph);
      EdResult.setText(content);
   }

   private void BtnRunActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_BtnRunActionPerformed
      Graph graph=new Graph(EdSource.getText(),true);
      convert(graph);
   }//GEN-LAST:event_BtnRunActionPerformed

   private void BtnMatrixActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_BtnMatrixActionPerformed
      Graph graph=new Graph(EdMatrix.getText(),false);
      convert(graph);
   }//GEN-LAST:event_BtnMatrixActionPerformed

